export const ranks = ['Tiger', 'Wolf', 'Bear', 'Webelos', 'Arrow of Light'];

export class Racer {
  private trans1x1 = 'data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7';

  // tslint:disable-next-line:max-line-length
  private arrowoflight = 'data:image/png;base64,';


  // tslint:disable-next-line:max-line-length
  private bear = 'data:image/png;base64,';

  // tslint:disable-next-line:max-line-length
  private tiger = 'data:image/png;base64,';

  // tslint:disable-next-line:max-line-length
  private webelos = 'data:image/png;base64,';


  // tslint:disable-next-line:max-line-length
  private wolf = 'data:image/png;base64,';

  public _id: string;
  public firstname: string;
  public lastname: string;
  public rank: string;
  public carname: string;
  public profilePhotoDataURL: string;
  public uid: string;

  constructor(racer?: Racer) {
    if (racer) {
      Object.assign(this, racer);
    }

    if (!this.profilePhotoDataURL) {
      this.profilePhotoDataURL = this.trans1x1;
    }
  }

  getSaveModel() {
    const rcr = Object.assign({}, this);

    delete rcr.trans1x1;
    delete rcr.arrowoflight;
    delete rcr.bear;
    delete rcr.tiger;
    delete rcr.webelos;
    delete rcr.wolf;

    return rcr;
  }

  setPhotoDataURLByRank(rank): void {
    // tslint:disable-next-line:curly
    if (this.profilePhotoDataURL !== this.trans1x1
      && this.profilePhotoDataURL !== this.arrowoflight
      && this.profilePhotoDataURL !== this.bear
      && this.profilePhotoDataURL !== this.tiger
      && this.profilePhotoDataURL !== this.webelos
      && this.profilePhotoDataURL !== this.wolf) return;

    switch (rank) {
      case 'Arrow of Light':
        this.profilePhotoDataURL = this.arrowoflight;
        break;
      case 'Bear':
        this.profilePhotoDataURL = this.bear;
        break;
      case 'Tiger':
        this.profilePhotoDataURL = this.tiger;
        break;
      case 'Webelos':
        this.profilePhotoDataURL = this.webelos;
        break;
      case 'Wolf':
        this.profilePhotoDataURL = this.wolf;
        break;
      default:
        this.profilePhotoDataURL = this.trans1x1;
        break;
    };
  }

  reset() {
    this.firstname = '';
    this.lastname = '';
    this.rank = '';
    this.profilePhotoDataURL = this.trans1x1;
  }
};
